  const [choosen, setChooesn] = useState(true);
  const pageChange = (event) => {
    setPage(event.target.value);
  };
  useEffect(() => {
    setChooesn((prev) => !prev);
  }, [page]);
  console.log(choosen);
  console.log(page);
  return (
    <div>
      {page === "todo" ? <Todo_list /> : null}
      {page === "coin" ? <Coin_Tracker /> : null}
      {page === "movie" ? <Movie /> : null}
    </div>
  );
}
root.render(<APP />);

